import React from 'react';
import data from '../asset/data';

class Navul extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            navUl: data.navList,
        };
    }

    render() {
        let { navUl } = this.state;
        return (
            <ul id="nav11">
                <li>
                    <a href="">免费课程</a>
                </li>
            </ul>
        )
    }

}

export default Navul;
